];

var baseUrl = 'http://127.0.0.1:5000/token:qwhu67fv56frt5drfx45e/branches';
//

export function ShowBranches({ branchesList }) {
  return (
    <div>
      <div className="column justify-content-between d-flex">
        <h1 className="pb-4">List Of Branches</h1>
        <Link to="new">
          <Button
            color=""
            bgColor="var(--primary-color)"
            name="Add Branch"
            id="addBranchBtn"
            className="btn px-4"
          />
        </Link>
      </div>
      {branchesList.map((branch) => {
        console.log(branch);
        return (
          <div>
            <div className="container-md cardContainer mb-4 shadow g-o row pt-4 d-flex justify-content-center">
              <div className="column col-5 h-100">
                <div className="container-fluid">
                  <div className="row text-center h3">
                    <span>
                      {' '}
                      <b>{branch.name}</b>{' '}
                    </span>
                  </div>
                  <div className="row"></div>
                  <div className="row ">
                    <span>
                      <b>Id :</b> {branch.id}
                    </span>
                  </div>

                  <div className="row">
                    <p>
                      <b>Description : </b>
                      {branch.description}
                    </p>
